body { -webkit-font-smoothing: antialiased; text-rendering: optimizelegibility; }[tabindex]:focus-visible, input[type="file"]:focus-visible { outline: rgb(77, 101, 255) solid 0.125rem; outline-offset: 0.125rem; }.w-richtext > :not(div):first-child, .w-richtext > div:first-child > :first-child { margin-top: 0px !important; }.w-richtext > :last-child, .w-richtext ol li:last-child, .w-richtext ul li:last-child { margin-bottom: 0px !important; }.pointer-events-off { pointer-events: none; }.pointer-events-on { pointer-events: auto; }.container-medium, .container-small, .container-large { margin-right: auto !important; margin-left: auto !important; }input:focus { outline-color: rgb(11, 35, 48) !important; }.sprig-feedback-button-dark { background-color: rgb(11, 35, 48) !important; border: 1px solid rgb(11, 35, 48) !important; }.sprig-feedback-button-label { font-family: "TT Commons Pro", sans-serif !important; font-weight: 600 !important; line-height: 100% !important; }.product-dropshadow { filter: drop-shadow(rgba(11, 35, 48, 0.03) 0px 4px 12px) drop-shadow(rgba(11, 35, 48, 0.05) 0px 16px 24px); }.dropshadow { box-shadow: rgba(11, 35, 48, 0.03) 0px 4px 12px, rgba(11, 35, 48, 0.05) 0px 16px 24px; }.nav_menu-dropdown, .nav_container-mobile-menu, .nav { box-shadow: rgba(11, 35, 48, 0.03) 0px 8px 8px; }.max-content { width: max-content; }.w-slider-dot { border: 2px solid rgb(80, 96, 103) !important; background-color: rgba(0, 0, 0, 0) !important; }.w-slider-dot.w-active { border: 2px solid rgb(11, 35, 48) !important; background-color: rgb(11, 35, 48) !important; }@media (max-width: 767px) {
  .w-slider-dot { width: 14px; height: 14px; }
}@media (max-width: 478px) {
  .w-slider-dot { width: 12px; height: 12px; }
}.text-rich-text blockquote { margin-top: 24px; margin-bottom: 24px; }.text-rich-text h1 > a { font-size: 48px; line-height: 125%; font-weight: 700; }.text-rich-text h2 > a { font-size: 32px; line-height: 125%; font-weight: 700; }.text-rich-text h3 > a { font-size: 24px; line-height: 125%; font-weight: 600; }.text-rich-text h4 > a { font-size: 20px; line-height: 140%; font-weight: 400; }.text-rich-text blockquote > a { font-size: 24px; line-height: 125%; font-weight: 600; }.text-rich-text li a { font-size: 18px; }@media (max-width: 991px) {
  .text-rich-text h1 > a { font-size: 40px; line-height: 125%; font-weight: 700; }
  .text-rich-text h2 > a { font-size: 28px; line-height: 125%; font-weight: 700; }
  .text-rich-text h3 > a { font-size: 22px; line-height: 125%; font-weight: 600; }
  .text-rich-text h4 > a { font-size: 18px; line-height: 140%; font-weight: 400; }
  .text-rich-text blockquote > a { font-size: 24px; line-height: 125%; font-weight: 600; }
  .text-rich-text li a { font-size: 16px; }
}@media (max-width: 767px) {
  .text-rich-text h1 > a { font-size: 32px; line-height: 125%; font-weight: 700; }
  .text-rich-text h2 > a { font-size: 24px; line-height: 125%; font-weight: 700; }
  .text-rich-text h3 > a { font-size: 20px; line-height: 125%; font-weight: 600; }
  .text-rich-text h4 > a { font-size: 18px; line-height: 140%; font-weight: 400; }
  .text-rich-text blockquote > a { font-size: 20px; line-height: 125%; font-weight: 600; }
  .product-overview_lottie, .product-hero-lottie { width: calc(-48px + 100vw); margin-left: -8px; margin-right: -8px; }
}

.w-dropdown-toggle.w--open .nav_link-wrapper { background-color: rgb(242, 237, 231); }.nav_menu-dropdown:hover { display: block !important; }.nav_secondary-element.is-enterprise:hover .read-more_link-block { border-bottom-color: rgb(11, 35, 48) !important; }.nav_menu-column { width: calc(33.33% - 27px); }.nav-menu-dropdown-container.is-4-column .nav_menu-column { width: calc(25% - 30.25px); }.nav-caret { transform: rotate(0deg); transition: all 0.2s ease-in-out 0s; }.w--open .nav-caret { transform: rotate(180deg); transition: all 0.2s ease-in-out 0s; }.is-mobile-nav-caret { transform: rotate(180deg); transition: all 0.2s ease-in-out 0s; }.w--open .is-mobile-nav-caret { transform: rotate(0deg); transition: all 0.2s ease-in-out 0s; }.nav_section-item.is-vertical .nav_section-header { border-bottom: 2px solid rgba(255, 255, 255, 0) !important; }@media (max-width: 1080px) and (min-width: 992px) {
  .nav_container { gap: 12px; }
  .nav_link-wrapper { font-size: 13px; }
  .nav_buttons .button.is-small { padding-left: 14px; padding-right: 14px; font-size: 13px; }
  .nav_menu-container { gap: 12px; }
}

.has-arrow { position: relative; }@media (min-width: 992px) {
  .has-arrow::after { content: ""; background-image: url("https://cdn.prod.website-files.com/651206cc884d0caef0f4c520/65982fab42955f1e5ec5027e_arrow.svg"); position: absolute; height: 144px; width: 144px; bottom: 32px; right: -160px; background-size: contain; background-repeat: no-repeat; }
}

